import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import { Paper, Grid, Typography } from '@material-ui/core/'
import LoggedUserHeader from '../components/LoggedUserHeader'

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    display: 'flex',
  },
  paper: {
    padding: theme.spacing(3),
    textAlign: 'justified',
    color: theme.palette.text.secondary,
  },
  paperTable: {
    padding: theme.spacing(0),
    color: theme.palette.text.secondary,
  },
  sectionTitle: {
    fontSize: '2rem',
    marginBottom: '0.3rem',
    textAlign: 'left',
    color: 'black',
  },
  sectionSubTitle: {
    fontSize: '1.5rem',
    marginBottom: '0.3rem',
    textAlign: 'left',
    color: 'black',
  },
  userName: {
    fontSize: '1.3rem',
    marginBottom: '0.3rem',
    textAlign: 'left',
    color: 'black',
  },
  fullColumn: {
    height: '100%',
  },
  content: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.default,
  },
  toolbar: theme.mixins.toolbar,
}))

const Help = () => {
  const classes = useStyles()
  return (
    <>
      <LoggedUserHeader />
      <div className={classes.content}>
        <div className={classes.toolbar}></div>
        <Grid container spacing={0} xs={12}>
          <Grid item xs={12}>
            <Paper className={classes.paper}>
              <Typography
                variant="h2"
                color="initial"
                className={classes.sectionTitle}
              >
                Ayuda
              </Typography>
              <Typography color="initial" className={classes.sectionSubTitle}>
                ¿Qué es Mi Presupuesto?
              </Typography>
              <Typography variant="body1" color="initial">
                Mi presupuesto es una solución sencilla y práctica para la
                administración de su presupuesto personal.
              </Typography>
            </Paper>
          </Grid>
        </Grid>
      </div>
    </>
  )
}

export default Help
